import './App.css';

class App extends React.Component {
  render() {
    return (
      <form className="form">
        <label for="cidade">Cidade:
        <select className="cidade">
          <option value="value0">  </option>
          <option value="value1">bh</option>
          <option value="value2">rj</option>
          <option value="value3">sp</option>
        </select>
        </label> <br />
        <label for="name">Nome: 
        <input id="name" type="text"></input>
        </label><br />
        <label for="idade">Idade: 
        <input id="idade" type="textnumber"></input>
        </label><br />
        <label for="text">Texto:
        <textarea></textarea>
        </label><br />
      </form>
    )
  }
}

export default App;
